import React from 'react'
import { AiFillCloseCircle } from "react-icons/ai";
export default function Close() {
  return (
    <div className="absolute left-1/2 text-4xl text-white bottom-10 hover:text-6xl hover:cursor-pointer">
          <AiFillCloseCircle />
    </div>
  )
}
